export const ApiKey  = "?api_key=1c96fc85-d24e-4b1e-997c-9d7e97a28f4c"
export const Url = "https://project-2-api.herokuapp.com/"
export const VideoArray = "videos/"

export const Request1 = axios.get(Url + VideoArray + ApiKey)
		.then(response =>{
			this.setState({videoList: response.data})
			this.setState({currentId: response.data[0].id})
			console.log(this.state.currentId)
		})
